import React from 'react'

export default function UsersMainView() {
  return (
    <div className='w-100 h-100'>
        <div className='row'>
            <div className='mx-3'>
                <h3 className='mb-0'>Usuarios</h3>
                <hr className='my-0' />
            </div>
        </div>
    </div>
  )
}
